script: |
  super -f text -I q3410.spq | sort > q3410.out

inputs:
  - name: q3410.spq
    data: |
      SELECT DISTINCT + + col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 50 + col1 * - 59 + - col0 BETWEEN col2 AND NULL;
  - name: tab2

outputs:
  - name: q3410.out
    data: |
      51
      67
      77
